import React from "react";
import styled from "styled-components";
import Header from "../../components/SignUp/Header";
import LoginForm from "../../components/SignIn/LoginForm";

function SignIn() {
  return (
    <AppWrapper>
      <Header />
      <MainContent>
        <Card>
          <LoginForm />
          <ImageSection>
            <WildlifeImage loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/cce93baded15cf78beafdae5e82e359b245c19b27d59da6ad1ee73fc4f71def7?apiKey=e3765372b84f44f7af794f9207eac8b0&" alt="Wildlife" />
          </ImageSection>
        </Card>
      </MainContent>
    </AppWrapper>
  );
}

const Container = styled.div`
  border: 1px solid rgba(161, 161, 161, 1);
  background-color: #fff;
  display: flex;
  flex-direction: column;
  padding: 48px 0 80px;
`;

const MainContent = styled.main`
  display: flex;
  align-self: center;
  margin-top: 40px;
  width: 100%;
  max-width: 1075px;
  gap: 20px;

  @media (max-width: 991px) {
    flex-direction: column;
    align-items: stretch;
    gap: 0;
    max-width: 100%;
  }
`;

const ImageColumn = styled.div`
  display: flex;
  flex-direction: column;
  line-height: normal;
  width: 45%;
  margin-left: 20px;

  @media (max-width: 991px) {
    width: 100%;
    margin-left: 0;
  }
`;

const WildlifeImage = styled.img`
  aspect-ratio: 0.63;
  object-fit: cover;
  width: 100%;
  flex-grow: 1;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-top: 40px;
  }
`;

export default SignIn;
